import React, { Component } from 'react';


class Navigation extends Component {
    render(){
        return(
            <nav className="navbar navbar-dark bg-dark">
                <a href="https://www.google.com" className="text-white">
                    { this.tittle }
                </a>
            </nav>
        )
    }
}

export default Navigation;
